import React, { Component } from 'react';


class Logo_mpt extends Component{
    render(){
        return (
            <View style = {styles.centerContent}>
         <Image 
            style= { style,imgstyle}
            source = { require( './src/imgs/calculadora.png' )}
         >
         </Image>
         </View>
        );
    }
}

const styles = StyleSheet.create({
    centerContent: {
        justifyContent: 'center',
        alignItems:'center'
    },
    imgstyle:{
        width:100,
        height: 100,
        marginTop: 30
    }

}
);
export default Logo_mpt;
